import './App.css';
import CollectionCard from './components/CollectionCard';
import Header from './components/Header';
import{ useState, useEffect }  from 'react';
import axios from 'axios';


function App() { 
const [Punklistdata, setPunklistdata] = useState([]);

  useEffect(() => {
    const getMyNfts = async () => {

      const openseaData = await axios.get('https://testnets-api.opensea.io/assets?asset_contract_address=0x01df5ae7Ee67a583116De8ff53f6954871784FD4&order_direction=asc')
      console.log(openseaData.data.assets)
      setPunklistdata(openseaData.data.assets)
    }

       getMyNfts()
    }, [])

  console.log(Punklistdata)


  return (
    <div className='app'>
    <Header />
    <CollectionCard 
    id={0} 
    name={'punkList'} 
    traits={[{'value': 7}]} 
    image='https://i.seadn.io/gae/SuPXcvDKA_rp9mcYJzxtrT-Wy_6aGFrs8G0J3ZJXdZ6zmSkkKqjVIHWcm0s6ZzPOXu-i7CnuiN36ZP4_JEe1FLVw2aa_IwR2Gpop2w?auto=format&w=1000'
    />
    <punkList punkListdata={Punklistdata}/>

    <CollectionCard 
    id={1} 
    name={'punkList'} 
    traits={[{'value': 2}]} 
    image='https://nftevening.com/wp-content/uploads/2022/03/1h4M-XGF_400x400.jpeg'
    />
    <CollectionCard 
    id={1} 
    name={'punkList'} 
    traits={[{'value': 2}]} 
    image='https://news.artnet.com/app/news-upload/2021/09/Yuga-Labs-Bored-Ape-Yacht-Club-4466.jpg'
    />
    <CollectionCard 
    id={1} 
    name={'punkList'} 
    traits={[{'value': 2}]} 
    image='https://static.cryptobriefing.com/wp-content/uploads/2022/01/31074857/bored-ape-unnamed-1-440x440.png'
    />
    <CollectionCard 
    id={1} 
    name={'punkList'} 
    traits={[{'value': 2}]} 
    image='https://themostexpensive.org/wp-content/uploads/2022/03/BORED-APE-8135.png'
    />
    <CollectionCard 
    id={1} 
    name={'punkList'} 
    traits={[{'value': 2}]} 
    image='https://themostexpensive.org/wp-content/uploads/2022/03/BORED-APE-544.png'
    />
    <CollectionCard 
    id={1} 
    name={'punkList'} 
    traits={[{'value': 2}]} 
    image='https://i.seadn.io/gcs/files/00e50bbe770cff62ededa7ffe5c11926.png?auto=format&w=1200'
    />
    </div>

  )

}
